import React from "react"

function Contact() {
	return (
		<div className="contact">
			<div className="container">
				<h1>Contact</h1>
				<h2>Need to get {"in"} touch?</h2>
				<p>"Reach me at omkar '{dot}' waingankar {at} berkeley {dot} edu and let's keep the conversation going!"</p>
			</div>
		</div>
	)
}

export default Contact
